		void load_botnames() {
			std::string extension = configuration.botNicknames.substr(configuration.botNicknames.find_last_of('.'));

			std::string d;
			d.resize(extension.size());
			std::transform(extension.begin(), extension.end(), d.begin(), ::tolower);

			if (d == ".txt") {
				// Used as a simple list

				botNamesSimpleList = true;

				std::string content =
					"Speedy\n"
					"Heby\n"
					"Rooky\n"
					"Snaky\n"
					"Wormy\n"
					"Enjoy\n"
					"Biggy\n"
					"Littly";

				if (file_exists(configuration.botNicknames)) {
					std::ifstream ifs(configuration.botNicknames);
					std::string testcontent((std::istreambuf_iterator<char>(ifs)), (std::istreambuf_iterator<char>()));
					if (testcontent.empty()) {
						console.warn(std::cout) << "'" << termcolor::on_red << configuration.botNicknames << termcolor::reset << "' file : Empty... Default Botnames is used" << std::endl;
					} else {
						content = testcontent;
					}
				} else {
					file_create(configuration.botNicknames, content);
				}

				botNamesList = split(content, "\n");
				console.game(std::cout) << botNamesList.size() << " Botnames loaded!" << std::endl;
				
			} else if (d == ".json") {
				// Used as a complex json object

				botNamesSimpleList = false;

				Json::Value data;

				int index = 0;
				data[index]["name"] = "Speedy";
				data[index]["proportion"] = 1;
				data[index]["skin"] = "ALL";

				index++;
				data[index]["name"] = "Heby";
				data[index]["proportion"] = 1;
				data[index]["skin"] = "ALL";

				index++;
				data[index]["name"] = "Rooky";
				data[index]["proportion"] = 1;
				data[index]["skin"] = "ALL";

				index++;
				data[index]["name"] = "Snaky";
				data[index]["proportion"] = 1;
				data[index]["skin"] = "ALL";

				index++;
				data[index]["name"] = "Wormy";
				data[index]["proportion"] = 1;
				data[index]["skin"] = "ALL";

				index++;
				data[index]["name"] = "Enjoy";
				data[index]["proportion"] = 1;
				data[index]["skin"] = "ALL";

				index++;
				data[index]["name"] = "Biggy";
				data[index]["proportion"] = 1;
				data[index]["skin"] = "ALL";

				index++;
				data[index]["name"] = "Littly";
				data[index]["proportion"] = 1;
				data[index]["skin"] = "ALL";

				if (file_exists(configuration.botNicknames)) {
					std::ifstream ifs(configuration.botNicknames);
					std::string content((std::istreambuf_iterator<char>(ifs)), (std::istreambuf_iterator<char>()));
					Json::Value root;
					Json::Reader reader;
					bool parsingSuccessful = reader.parse(content, root);
					if (parsingSuccessful) {
						data = root;
					}
					else {
						console.warn(std::cout) << "'" << termcolor::on_red << configuration.botNicknames << termcolor::reset << "' file : Bad JSON... Default Botnames is used" << std::endl;
					}
				} else {
					std::ofstream configfile;
					configfile.open(configuration.botNicknames);
					configfile << data;
					configfile.close();
				}
				botNamesComplexList = data;

				double_t total_proportion = 0;
				for (Json::Value::ArrayIndex id = 0; id != botNamesComplexList.size(); id++) {
					if (botNamesComplexList[id].isObject()) {
						if (botNamesComplexList[id].isMember("proportion")) {
							total_proportion += botNamesComplexList[id].get("proportion", 1.0).asDouble();
						} else {
							botNamesComplexList[id]["proportion"] = 1.0;
							total_proportion += 1.0;
						}
						if (botNamesComplexList[id].isMember("skin")) {
							if (botNamesComplexList[id]["skin"].isString()) {
								std::string v = botNamesComplexList[id]["skin"].asString();
								if (v != "ALL") {
									botNamesSkinData[id] = split_nb(v, ";");
								}
							}
						} else {
							botNamesComplexList[id]["skin"] = "ALL";
						}
					}
				}

				// normalize proportion
				for (Json::Value::ArrayIndex id = 0; id != botNamesComplexList.size(); id++) {
					if (botNamesComplexList[id].isObject()) {
						botNamesComplexList[id]["proportion"] = botNamesComplexList[id]["proportion"].asDouble() / total_proportion;
						for (int j = 0; j < botNamesComplexList[id]["proportion"].asDouble() * 100; j++) {
							botnames_proportions.push_back(id);
						}
					}
				}

				console.game(std::cout) << botNamesComplexList.size() << " Botnames loaded!" << std::endl;
			}
		}
