		std::vector<int> split_nb(std::string phrase, std::string delimiter) {
			std::vector<int> list;
			std::string s = std::string(phrase);
			size_t pos = 0;
			std::string token;
			while ((pos = s.find(delimiter)) != std::string::npos) {
				token = s.substr(0, pos);
				std::string token_trim = trim(token);
				if (is_number(token_trim)) {
					list.push_back(std::stoi(token_trim));
				}
				s.erase(0, pos + delimiter.length());
			}
			std::string s_trim = trim(s);
			if (is_number(s_trim)) {
				list.push_back(std::stoi(s_trim));
			}
			return list;
		}
